var iterations = location.hash.substring(1); //checks number of times the function has been iterated using a URL hash
var iterationsMax = 30; //sets the maximum number of times you want the script to iterate, you can change this
//sets first iteration to 0
if(iterations === "NaN"){
	iterations = 0;
}
iterations = parseInt(iterations)+1

if(iterations > iterationsMax){
	return false;
}

setTimeout(function() {
    
    //generates a random word from our dictionary list
    var keyWord = randomWord();
    
    //performs a new search
    open("http://www.bing.com/search?q="+keyWord+"#"+iterations,"_self");
    
}, (Math.random()*10000+10000));//creates a random bumber from 10 to 20 for the seconds timer

